import React from "react";
import FormattedDate from "./FormattedDate";
import WeatherIcon from "./WeatherIcon";

import WeatherTemperature from "./WeatherTemperature";

export default function WeatherInfo(props) {
  return (
    <div>
      <div className="WeatherInfo overview">
        <h1 className="place text-left">{props.data.city}</h1>
        <div className="row overview-info ">
          <div className="d-flex">
            <WeatherIcon code={props.data.icon} size={550} />
            <WeatherTemperature celsius={props.data.temperature} />
          </div>
          <p>
            <div>
              <FormattedDate date={props.data.date} />
            </div>
            <div>
              <strong>
                {" "}
                <em>{props.data.description}</em>{" "}
              </strong>
            </div>
            <div>Humidity: {props.data.humidity}%</div>
            <div>Wind: {props.data.wind}km/h</div>
          </p>
          <div className="col-4 pb-3 info"></div>
        </div>
      </div>
    </div>
  );
}
